(5, 5, 4, 4, 'É TANTA', 'Dm  Dm7  F°  E7  Am  Am  F7+  E7', '<p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde Am m-0 p-0 \">Am</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm m-0 p-0 \">Dm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">É tanta, emoção que eu sinto</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 m-0 p-0 \">G7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C m-0 p-0 \">C</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Toda vez que minto, tentando esconder</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Eb° m-0 p-0 \">Eb°</span> <span class=\"acorde B7 m-0 p-0 \">B7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 m-0 p-0 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Ela já não me ama..... ela já não vê</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde <br> m-0 p-0 \"><br></span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Como me viu um dia</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm m-0 p-0 \">Dm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">A moça, resolveu ir embora</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 m-0 p-0 \">G7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C m-0 p-0 \">C</span>&nbsp;&nbsp;<span class=\"acorde C7+ m-0 p-0 \">C7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Meu Deus e agora o que faço eu</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Eb° m-0 p-0 \">Eb°</span> <span class=\"acorde B7 m-0 p-0 \">B7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 m-0 p-0 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Falo que não foi nada..... digo que não doeu</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span>&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span> ^<span class=\"acorde Ab7 m-0 p-0 \">Ab7</span>^<span class=\"acorde G7 m-0 p-0 \">G7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Pra tentar ocultar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C m-0 p-0 \">C</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 m-0 p-0 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">A vontade que sinto de saber, amor</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde <br> m-0 p-0 \"><br></span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">O seu novo endereço</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Em5-/7 m-0 p-0 \">Em5-/7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm m-0 p-0 \">Dm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E te escrever dizendo assim, amor</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm/C m-0 p-0 \">Dm/C</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 m-0 p-0 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Volte logo que a vontade, de te ver</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">É tanta</p>', '[\"Am\",\"Dm\",\"G7\",\"C\",\"Eb\\u00b0\",\"B7\",\"E7\",\"C7+\",\"Ab7\",\"Em5-\\/7\",\"A7\",\"Dm\\/C\"]', '2025-04-11 22:09:57', '2025-04-11 22:09:57', 'Serginho Meriti, Cacá Franklin'),
(6, 6, 3, 5, 'NASCENTE DA PAZ', 'C7 F F#°', '<p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Bororó (bororó)... Bororó (bororó)</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F6 m-0 p-0 \">F6</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Bororó, (bororóoooooo)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde <br> m-0 p-0 \"><br></span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">---------- Refrão bis --------&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F6 m-0 p-0 \">F6</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">O meu sonho verdadeiro, é gostoso de sonhar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm7 m-0 p-0 \">Cm7</span>&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Todo mundo no terreiro, indo até o sol raiar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F7 m-0 p-0 \">F7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bb7+ m-0 p-0 \">Bb7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C/Bb m-0 p-0 \">C/Bb</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am7 m-0 p-0 \">Am7</span>&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Sob a luz da poesia, é tão doce de cantar&nbsp;&nbsp;&nbsp;.......</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F6 m-0 p-0 \">F6</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E ao som dos tantãs e dos balangandãs, eu não quero para&nbsp;&nbsp;...</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F6 m-0 p-0 \">F6</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vou sambando, sorrindo, cantando, ao sabor do luar ....</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm m-0 p-0 \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7/9 m-0 p-0 \">C7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nb