 color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C m-0 p-0 \">C</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A5+/7 m-0 p-0 \">A5+/7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Num momento de prazer . . . ou de amor</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D m-0 p-0 \">D</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Mas tudo bem</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m m-0 p-0 \">F#m</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Eu sei que um dia vai e outro vem</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Você ainda há de encontrar alguém</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G m-0 p-0 \">G</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vai lhe fazer o que você me fez</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span>&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E ai....... na hora do sufoco</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m7 m-0 p-0 \">F#m7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm m-0 p-0 \">Bm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Sei você vai me procurar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Em m-0 p-0 \">Em</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Com a mesma conversa que um dia me fez apaixonar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am m-0 p-0 \">Am</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 m-0 p-0 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Por alguém de uma falsa consideração.</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G m-0 p-0 \">G</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m7 m-0 p-0 \">F#m7</span>&nbsp;&nbsp;<span class=\"acorde B7 m-0 p-0 \">B7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E ai . . .você vai perceber que eu estou numa boa</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7/9 m-0 p-0 \">E7/9</span>&nbsp;&nbsp;<span class=\"acorde Gm6 m-0 p-0 \">Gm6</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Que durante algum tempo fiquei sem ninguém</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D m-0 p-0 \">D</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">mas há males na vida que vem para o bem</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Agora</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde <br> m-0 p-0 \"><br></span></p>', '[\"D\",\"F#m\",\"Am\",\"D7\",\"G\",\"A7\",\"F#7\",\"Bm\",\"Em\",\"C\",\"A5+\\/7\",\"F#m7\",\"B7\",\"E7\\/9\",\"Gm6\"]', '2025-04-12 19:40:26', '2025-04-12 19:40:26', 'Marquinho