(20, 12, 1, 3, 'PAPO DE HOMEM E MULHER', 'Am A7', '<p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde Dm m-0 p-0 \">Dm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 m-0 p-0 \">G7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vem pra ficar, amor</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C6/9 m-0 p-0 \">C6/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Esquece de uma faz solidão</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\"><span class=\"acorde Bb7 m-0 p-0 \">Bb7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7 m-0 p-0 \">A7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm m-0 p-0 \">Dm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">O amor te atendeu e disse pode entrar</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; font-style: italic; line-height: 0.8; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bb7 m-0 p-0 \">Bb7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 m-0 p-0 \">E7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span clas