m \">Gm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G#5-/7 \">G#5-/7</span>^<span class=\"acorde G7 \">G7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vamos sobrevoar sem um passo dar&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am5-/7 \">Am5-/7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7+ \">G7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Na 2ª vez (Vamos sobrevoar sem um passo dar ...&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;) e volta no *&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde <br> \"><br></span></p>', '[\"Gm\",\"Cm7\",\"D7\\/13\",\"Am5-\\/7\",\"Dm5-\\/7\",\"G5-\\/7\",\"F7\\/9\",\"Bb7+\",\"Eb7+\",\"D7\\/9\",\"G7+\",\"B6\\/7\",\"Em7\",\"Dm7\\/9\",\"G7\",\"C7+\",\"Bm\",\"E7\",\"A7\",\"G#5-\\/7\",\"D7\"]', '2025-04-18 11:53:54', '2025-04-18 11:53:54', NULL);
