(41, 22, 1, 2, 'ME LEVA', 'F G7 Em A7 Dm Em F F#° G7', '<p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde C \">C</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 \">G7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Tudo nasceu de brincadeira</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde Am \">Am</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Nas cordilheiras da ilusão</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde F \">F</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C \">C</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Veio num vento sem destino</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 \">G7</span>&nbsp;&nbsp;<span class=\"acorde G7/13- \">