 0.8em; line-height: 1.5; font-weight: bold; \">Agradeço à voz</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C5+/7 \">C5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F7+ \">F7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Que me deu a indicação</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm7 \">Cm7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Hoje tenho meu corpo fechado</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F7 \">F7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bb \">Bb</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E purificado de amor e paixão</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde Gm6 \">Gm6</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Se não fosse a água</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde C5+/7 \">C5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F7+ \">F7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Que curou a mágoa do meu coração</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Gm6 \">Gm6</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Minha vida era tristeza</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C5+/7 \">C5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F7+ \">F7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">E eu morreria de tanta paixão</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">PEDIRAM NA PALMA DA MÃO</p>', '[\"D7\",\"Gm6\",\"C5+\\/7\",\"F7+\",\"Cm7\",\"F7\",\"Bb\"]', '2025-04-20 20:10:41', '2025-04-20 20:21:20', 'Desconhecido'),
(48, 30, 4, 1, 'CONDOR', 'F6  G7+  G6', '<p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde G7+ \">G7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm7 \">Bm7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm \">Dm</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Deixa eu....larga eu&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7 \">G7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde C7+ \">C7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Meu amor, eu não agüento mais&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm6 \">Cm6</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Me deixe em paz&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm7 \">Bm7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Te peço por favor&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am7 \">Am7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7+ \">G7+</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Chega de tanto sofrer, de tanta dor&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde F#m5-/7 \">F#m5-/7</span> ^ <span class=\"acorde B5+/7 \">B5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Em7/9 \">Em7/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Lá.......lá......iá</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m5-/7 \">F#m5-/7</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde B5+/7 \">B5+/7</span>&nbsp;&nbsp;&nbsp;<span class=\"acorde Em7/9 \">Em7/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vou sair.......por.....aí</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m5-/7 \">F#m5-/7</span>&nbsp;&nbsp;&nbsp;<span class=\"acorde B5+/7 \">B5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Em7/9 \">Em7/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vou fazer........um.....auê</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde F#m5-/7 \">F#m5-/7</span>&nbsp;&nbsp;&nbsp;<span class=\"acorde B5+/7 \">B5+/7</span>&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Em7 \">Em7</span> ^ <span class=\"acorde Ebm \">Ebm</span>&nbsp;&nbsp;<span class=\"acorde Dm \">Dm</span> <span class=\"acorde + \">+</span>&nbsp;&nbsp;<span class=\"acorde Db7/9 \">Db7/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Coração.......tá....durão</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde C7+ \">C7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm6 \">Cm6</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm7 \">Bm7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Che....ga.....sentimento paranóico é demais&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde A7/9 \">A7/9</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am7/9 \">Am7/9</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Vou buscar a minha paz, liberdade pra viver&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm \">Dm</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Faço tudo pra esquecer, um grande amor!&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde C7+ \">C7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm6 \">Cm6</span>&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm7 \">Bm7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">...Leleleô........leleleô</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;<span class=\"acorde Am7 \">Am7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Dm \">Dm</span>&nbsp;&nbsp;</p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Eu quero voar bem mais alto que um condor</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\"><span class=\"acorde C7+ \">C7+</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Cm6 \">Cm6</span>&nbsp;&nbsp;&nbsp;<span class=\"acorde Bm7 \">Bm7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde E7 \">E7</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">...Leleleô........leleleô</p><p class=\"m-0 p-0 mt-1\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; color:green;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde Am7 \">Am7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde D7 \">D7</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span class=\"acorde G7+ \">G7+</span>&nbsp;&nbsp;<span class=\"acorde D7/9- \">D7/9-</span></p><p class=\"m-0 p-0\" style=\"font-size: 0.8em; line-height: 1.5; font-weight: bold; \">Eu quero voar bem mais alto que um condor</p>', '[\"G7+\",\"Bm7\",\"Dm\",\"G7\",\"C7+\",\"Cm6\",\"E7\",\"Am7\",\"D7\",\"F#m5-\\/7\",\"B5+\\/7\",\"Em7\\/9\",\"Em7\",\"Ebm\",\"+\",\"Db7\\/9\",\"A7\\/9\",\"Am7\\/9\",\"D7\\/9-\"]', '2025-04-21 20:32:08', '2025-04-21 20:32:08', NULL);
